<?phpnamespace Nemundo\App\Help\Script;use Nemundo\App\Help\Setup\HelpSetup;use Nemundo\App\Script\Type\AbstractConsoleScript;use Nemundo\Core\CoreRepository;use Nemundo\Db\DbRepository;use Nemundo\FrameworkProject;use Nemundo\Html\HtmlRepository;class HelpImportScript extends AbstractConsoleScript{    protected function loadScript()    {        $this->scriptName = 'help-import';    }    public function run()    {        (new HelpSetup())            ->addProject(new CoreRepository())            ->addProject(new DbRepository())            ->addProject(new HtmlRepository())            ->addProject(new FrameworkProject());    }}